import WsProvider from '../Provider/WSProvider'
var UserService = {
  changepassword: (param) => {
    var deferred = new Promise(function (resolve, reject) {
      WsProvider.ajaxPost('http://89.252.181.4:8071/hakanbt/onlinesatis-api/view/Kullanici.php', param).then((response) => {
        resolve(response)
      })
    })
    return deferred
  }

}
export default UserService
